import React, { Component } from "react";
import { Table } from 'react-bootstrap'
import "./LoadStockTable.css";

class LoadStockTable extends Component{
    render()
    {
            return (
            <div className="main-container">
                <Table className="table table-fixed" bsPrefix="table-css" size="sm">
                        <tbody>
                            <tr>
                                <td>Date</td>
                                <td>Open</td>
                                <td>High</td>
                                <td>Low</td>
                                <td>Close</td>
                                <td>Volume</td>
                            </tr>

                            {
                                console.log(this.props.stockprice)
                                // this.props.stockprice.map(item=>(
                                // <tr>
                                //     <td>{item.date}</td>
                                //     <td>{item.open}</td>
                                //     <td>{item.high}</td>
                                //     <td>{item.low}</td>
                                //     <td>{item.close}</td>
                                //     <td>{item.volume}</td>
                                // </tr>))
                            };
                        </tbody>
                    </Table>
            </div>);
    }
}

export default LoadStockTable
